import { StyleSheet } from "react-native";
import { SIZES } from '../../constants/theme'

const slides = StyleSheet.create({
  image: {
    resizeMode: 'cover',
    width: SIZES.width,
    height: SIZES.height
  },
  stack: {
    position: 'absolute',
    bottom: 0,
    marginBottom: 60,
    marginHorizontal: 20
  }
})

export default slides
